import WineCard from '../WineCard/WineCard';

export default function WineList (props) {

  return (<div>

    <div className="wine__card__container">

    {props.location.wineList.map((wine,index) => {
      return (<div><WineCard wine={wine} /></div>)})}

    </div>


  </div>)

}
